import React from 'react'
import ReactDOM from 'react-dom'
import asabaneh from './images/asabeneh.jpg'



class Header extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {

        const { 
            welcome,
            title,
            subtitle,
            author:{ firstName, lastName},
            date
        }= this.props.data


        return(
            <header>
                <div className="header-wrapper">
                    <h1>{welcome}</h1>
                    <h2>{title}</h2>
                    <h3>{subtitle}</h3>
                    <p>{firstName} {lastName}</p>
                    <small>{date}</small>
                </div>
            </header>
        )
    }
}


